import React from "react"

function Joke(props){

    const s={display: block}
    if (props.question === null){
        s={display: none}
    }

    return(
        <div>
            <h3 style={s}>Question: {props.question}</h3>
            <h3>Answer: {props.answer}</h3>
            <hr/>
        </div>
    )
}

export default Joke
